class Solution:
    def findMaxForm(self, strs, m, n):
        res=dict()
        length=len(strs)
        count01=list()
        for s in strs:
            count1=0
            for i in range(len(s)):
                count1+=eval(s[i])
            count01.append((len(s)-count1,count1))
        for i in range(length+1):
            res[i,0,0]=0
        for i in range(m+1):
            for j in range(n+1):
                res[0,i,j]=0
        for i in range(1,length+1):
            for j in range(m+1):
                for k in range(n+1):
                    if j-count01[i-1][0]<0 or k-count01[i-1][1]<0:
                        res[i,j,k]=res[i-1,j,k]
                    else:
                        res[i,j,k]=max(res[i-1,j,k],res[i-1,j-count01[i-1][0],k-count01[i-1][1]]+1)
        return res[length,m,n]

